import React from "react";
import Product from "./product.js";

export default function Body() {
  fetch("./data/prodet.json")
    .then((res) => res.json())
    .then((data) => {
      const productComponents = prod.map((data) => {
        <Product key={data.id} name={data.name} details={data.det} />;
      });
    });

  return <div>{/* <div>{productComponents}</div> */}</div>;
}
